script: |
  super -f text -I q3413.spq | sort > q3413.out

inputs:
  - name: q3413.spq
    data: |
      SELECT ALL 48 * + 26 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE ( col0 * ( 73 ) - - col1 ) NOT BETWEEN ( - ( col0 ) + col1 ) AND ( + 43 );
  - name: tab1

outputs:
  - name: q3413.out
    data: |
      1248
      1248
      1248
